Description:
Input: Link shop Lazada, file cookies.json (dành cho việc đăng nhập tài khoản để cào dữ liệu) 
Output: Một file JSON như sau: 
{ 
 "shop_name": "...", 
 "shop_link": "...", 
 "products": [ 
 { 
 "product_name": "...", 
 "product_link": "...", 
 "product_description": "...", 
 "product_reviews": [ 
 { 
 "star": "...", 
 "description": "..." 
 } 
 ] 
 } 
 ] 
} 
Yêu cầu: 
- Từ input shop link, cào các sản phẩm, review của nó và số sao 
- Nếu bypass được chống automation của Lazada thì càng tốt, không phải đăng nhập đỡ bị giới hạn tài khoản.

